import React from "react";

function AboutMe() {
	return (
		<section>
			<h1>Hey, I'm Naail.</h1>
			<p>
				I'm an MIT-trained computer scientist interested in game theory, web
				development, and AI.
			</p>
			<p>
				In the past, I've engineered data pipelines at{" "}
				<a href="https://www.twosigma.com/">Two Sigma</a>; researched,
				developed, and tested prediction models at{" "}
				<a href="https://sig.com/">SIG</a>; and built internal tools for options
				trading at IMC.
			</p>
			<p>
				I'm an avid poker player and ex-president of the MIT Poker Club. I
				helped lead the first ever women's only poker tournament in Cambridge,
				Queen's Full House, and was an instuctor for 15.S50, a poker theory
				course taken by 100+ MIT students over IAP.
			</p>
			<p>Now, I'm working on creating an elo-based poker matchmaking system.</p>
		</section>
	);
}

export default AboutMe;
